children.defaultValue:
 forwardRef<Refs, Props>(
  ({ children, history }, ref) => {
    const historyInstance: HistoryManagement = useMemo(() => {
      return {
        initialSearch: () => history.location.search,
        push: (next: string) => {
          history.push({
            hash: history.location.hash,
            search: next,
            state: { __g__: true }
          })
        },
        replace: (next: string) =>
          history.replace({
            hash: history.location.hash,
            search: next,
            state: { __g__: true }
          })
      }
    }, [history])

    const value = useMemo(() => useGeschichte(historyInstance), [
      historyInstance
    ])
    const state = value(
      ({ unregister, updateFromQuery }: StoreState<any>) => ({
        unregister,
        updateFromQuery
      }),
      shallow
    )

    useEffect(() => {
      return history.listen((location, action) => {
        // don't handle our own actions
        if (
          (action === 'REPLACE' || action === 'PUSH') &&
          location.state &&
          // @ts-ignore
          location.state.__g__
        ) {
          return
        }
        state.updateFromQuery(location.search)
      })
    }, [history, state.updateFromQuery])

    useImperativeHandle(
      ref,
      () => ({
        updateFromQuery: state.updateFromQuery
      }),
      [state]
    )
    useEffect(() => {
      const { unregister } = state
      return () => {
        return unregister()
      }
    }, [state])
    return (
      <StoreContext.Provider value={value}>{children}</StoreContext.Provider>
    )
  }
)
